import React from 'react'
import styled from 'styled-components'

export default function Nome() {
  return (
    <Body>
        <label> 

          <span class="nome">Nome: </span>
          <br/>
          <Input type='text' name='nome' />

        </label>
    </Body>
  )
}

const Body = styled.body`
  width: 430px;
  background: #f2f2f2;
`

const Input = styled.input`
  width: 430px;
  height: 28px;
`
